// Roadmap.js
// 로드맵 페이지
import React from 'react';

const Roadmap = () => {
  return (
    <div className="road-map">
      <h1>로드맵 페이지</h1>
      <p>로드맵 페이지 구현</p>
    </div>
  );
};

export default Roadmap;
